def test_ResNet_BatchNorm2d_COMPOSITE_561(device, input_specs):
    torch.manual_seed(0)
    tensors = get_tensors_from_input_spec(input_specs, STATE_DICT)
    out_ref = ref_ResNet_BatchNorm2d_COMPOSITE_561(*tensors)[0]
    tensors[1:] = [t.unsqueeze(0).unsqueeze(2).unsqueeze(3) for t in tensors[1:]]
    tensors_tt = [ttnn.from_torch(t, dtype=ttnn.bfloat16, device=device, layout=ttnn.TILE_LAYOUT) for t in tensors]
    out_opt = ttnn_ResNet_BatchNorm2d_COMPOSITE_561(*tensors_tt)
    out_opt = ttnn.to_torch(out_opt)
    if torch.isnan(out_opt).any() and torch.isnan(out_ref).any():
        return
    elif not torch.isnan(out_opt).any() and torch.isnan(out_ref).any():
        assert False, "0 in output"
    elif torch.isnan(out_opt).any() and not torch.isnan(out_ref).any():
        assert False, "0 in torch output"
    diff = torch.abs(out_ref - out_opt)
    print(diff.mean(), diff.std(), diff.max(), diff.min())
    print(out_ref.mean(), out_ref.std(), out_ref.max(), out_ref.min())
    print(out_opt.mean(), out_opt.std(), out_opt.max(), out_opt.min())
    assert_with_pcc(out_ref, out_opt, 0.999)


