    torch.manual_seed(0)
    tensors = get_tensors_from_input_spec(input_specs, STATE_DICT)
    out_ref = ref_ResNet_Sequential_Bottleneck_Sequential_0_COMPOSITE_44(*tensors)[0]
    merged_weight, merged_bias = fold_batch_norm2d_into_conv2d(*tensors[1:], eps=1e-5)
    out_ref2 = torch.ops.aten.convolution(
        tensors[0], merged_weight, merged_bias, [1, 1], [0, 0], [1, 1], False, [0, 0], 1
    )
    assert torch.allclose(out_ref, out_ref2, atol=1e-5), "BatchNorm2d folding failed"
    weight, bias = Conv2dConfiguration.convert_torch_weight_and_bias_to_ttnn(tensors[1], merged_bias, mesh_mapper=None)
    tensors_tt = [ttnn.from_torch(t, dtype=ttnn.bfloat16, device=device) for t in tensors[:1]] + [weight, bias]
    tensors_tt[0] = ttnn.permute(tensors_tt[0], (0, 2, 3, 1))  # NCHW to NHWC
    out_opt = ttnn_ResNet_Sequential_Bottleneck_Sequential_0_COMPOSITE_44(*tensors_tt)
    out_opt = ttnn.reshape(
        out_opt,
        [
            int(a)
            for a in (
                tensors_tt[0].shape[0],
                tensors_tt[0].shape[1] - weight.shape[2] // 2,
                tensors_tt[0].shape[2] - weight.shape[3] // 2,
                out_opt.shape[3],
            )
        ],
    )
    out_opt = ttnn.permute(out_opt, (0, 3, 1, 2))  # NHWC to NCHW
    out_opt = ttnn.to_torch(out_opt)
    diff = torch.abs(out_ref2 - out_opt)
    print(diff.mean(), diff.std(), diff.max(), diff.min())
    print(out_ref2.mean(), out_ref2.std(), out_ref2.max(), out_ref2.min())
    print(out_opt.mean(), out_opt.std(), out_opt.max(), out_opt.min())
    assert_with_pcc(out_ref2, out_opt, 0.999)


