def test_SequenceINN_ModuleList_AllInOneBlock_subnetconvln_Conv2d_COMPOSITE_643(device, input_specs):
    torch.manual_seed(0)
    tensors = get_tensors_from_input_spec(input_specs, STATE_DICT)
    out_ref = ref_SequenceINN_ModuleList_AllInOneBlock_subnetconvln_Conv2d_COMPOSITE_643(*tensors)
    weight, bias = Conv2dConfiguration.convert_torch_weight_and_bias_to_ttnn(tensors[1], tensors[2], mesh_mapper=None)
    tensors_tt = [ttnn.from_torch(t, dtype=ttnn.bfloat16, device=device) for t in tensors[:1]] + [weight, bias]
    tensors_tt[0] = ttnn.permute(tensors_tt[0], (0, 2, 3, 1))  # NCHW to NHWC
    out_opt = ttnn_SequenceINN_ModuleList_AllInOneBlock_subnetconvln_Conv2d_COMPOSITE_643(*tensors_tt)
    out_opt = ttnn.reshape(
        out_opt,
        [
            int(a)
            for a in (
                tensors_tt[0].shape[0],
                tensors_tt[0].shape[1] - weight.shape[2] // 2,
                tensors_tt[0].shape[2] - weight.shape[3] // 2,
                out_opt.shape[3],
            )
        ],
    )
    out_opt = ttnn.permute(out_opt, (0, 3, 1, 2))  # NHWC to NCHW
    out_opt = ttnn.to_torch(out_opt)
    diff = torch.abs(out_ref - out_opt)
    print(diff.mean(), diff.std(), diff.max(), diff.min())
    print(out_ref.mean(), out_ref.std(), out_ref.max(), out_ref.min())
    print(out_opt.mean(), out_opt.std(), out_opt.max(), out_opt.min())
    assert_with_pcc(out_ref, out_opt, 0.999)


